import {React, useState} from "react";
import images from "../../constants/images";

import "./Navbar.sccs";

const Navbar = () => {

    const navbarItems = ["Collections", "Men", "Women", "About", "Contact"];

  return (
    <div className="app__navbar-wrap">
        <nav className="app__navbar">
            <div className="app__navbar-logo">
                <img src={images.logo} alt="navbar logo" />
            </div>

            <div className="app__navbar-links">
                <ul className="app__navbar-links_ul">
                    {["Collections"]}
                </ul>    
            </div>

            <div className="app__navbar-profile">
                <img src={images.iconCart} alt="cart" />
                <img src={images.Avatar} alt="avatar" />
            </div>
        </nav>
    </div>
  )
}

export default Navbar;
